// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.10;
/**
 * DAO contract:
 * 1. Collect investors money (ether)
 * 2. Keep track of investor contributions with shares
 * 3. Allow investors to transfer shares
 * 4. Allow investment proposals to be created and voted
 * 5. Execute successful investment proposals (ie. send money)
*/
contract DAO{

    struct Proposal{
        uint id;
        string name;
        uint amount;
        address payable recipient;
        uint votes;
        uint end;
        bool executed;
    }

    mapping(uint => Proposal) public proposals;
    mapping(address => bool) public investors;
    mapping(address => uint) public shares;
    mapping(address => mapping(uint => bool)) votes;
    mapping(address => uint) public numberOfVotes;
    uint public totalShares;
    uint public availableFunds;
    uint public contributionEnd;
    uint public nextProposalId;
    uint public voteTime;
    uint public quorum;
    address public admin;

    event proposalEdit(
          uint id,
          string name,
          uint amount,
          address recipient,
          uint votes,
          uint end,
          bool executed
      );

    event emitVote(
      uint proposalId,
      address sender,
      bool voted
    );


    constructor(
        uint contributionTime,
        uint _voteTime,
        uint _quorum){
            require(_quorum > 0 && _quorum < 100, "quorum must be between 0 and 100");
            contributionEnd = block.timestamp + contributionTime;
            voteTime = _voteTime;
            quorum = _quorum;
            admin = msg.sender;
    }

    function contribute() payable external{
        require(block.timestamp < contributionEnd, "Contribution period over");
        investors[msg.sender] = true;
        //1 Wei = 1 share, keep it simple
        shares[msg.sender] += msg.value;
        totalShares += msg.value;
        availableFunds += msg.value;
    }

    function getVoteStatus(address a, uint b) public view returns(bool){
      return votes[a][b];
    }

    //3. Allow investors to transfer shares
    //You need to make these shares 'sellable'
    //For investors to sell their shares, we need to deal with liquidity
    //If we just let anyone sell whenever, we are assuming that there is enough liquidity
    //1. Redeem your shares:
        //Ask the smart contract if you can sell your shares back to the smart contract
        //in exchange for your ether, for this you need liquidity
    //2. Transfer shares:
        //Investor A finds investor B who wants to buy shares off of him, after the contribution period
        //They agree on a price, once investor A receives ether, he transfers his shares to investor B


    //When somebody invests their money into something, they are hopinh to see some kind of monetary return on
    //investment. For this reason, it is not enough to just return the exact amount (1:1 ratio) that was put into the investment
    function redeemShare(uint amount) external{
        require(shares[msg.sender] >= amount, "Not enough shares");
        require(availableFunds >= amount, "Not enough available funds");
        shares[msg.sender] -= amount;
        availableFunds -= amount;
        totalShares -= amount;
        //This is flawed but we will leave it as is for now...
        payable(msg.sender).transfer(amount);
    }

    //The DAO has no knowledge of the Ether transfer that is occuring outside, all that it knows is to transfer shares
    //This process therefore needs to be coordinated by a third party
    function transferShares(uint amount, address to) external{
        require(shares[msg.sender] >= amount, "Not enough shares");
        shares[msg.sender] -= amount;
        shares[to] += amount;
        investors[to] = true;
    }

    //4. Allow investment proposals to be created and voted
        //1) One of the investors will create an investment proposal
        //2) Other investors will be abel to vote
    function createProposal(
        string memory name,
        uint amount,
        address payable recipient)
        external
        onlyInvestors(){
            require(availableFunds >= amount, "amount too big");
            proposals[nextProposalId] = Proposal(nextProposalId, name, amount, recipient, 0, block.timestamp+voteTime, false);
            availableFunds -= amount;
            nextProposalId++;
            emit proposalEdit(nextProposalId, name, amount, recipient, 0, block.timestamp+voteTime, false);
        }

    function vote(uint proposalId) external onlyInvestors(){
        //it is important that we set this variable to storage because otherwise Solidity will have trouble with
        //changing storage variables with memory variables
        Proposal storage prop = proposals[proposalId];
        require(votes[msg.sender][proposalId] == false, "Investor can only vote once for a proposal");
        require(block.timestamp < prop.end, "can only vote until proposal end");
        votes[msg.sender][proposalId] = true;
        prop.votes += shares[msg.sender];
        numberOfVotes[msg.sender]++;
        emit emitVote(proposalId, msg.sender, true);
    }


    function executeProposal(uint proposalId) external onlyAdmin(){
        Proposal storage prop = proposals[proposalId];
        require(block.timestamp >= prop.end, "Canno0t execute proposal before end date");
        require(prop.executed == false, "Cannot execute a proposal that has already been executed");
        require((100*prop.votes/totalShares) >= quorum, "Vote count below quorum");
        prop.executed = true;
        availableFunds += prop.amount;
        _transferEther(prop.amount, prop.recipient);
    }

    function withdrawEther(uint amount, address payable to) external onlyAdmin(){
        _transferEther(amount,to);
    }
    receive() payable external{}
    fallback() payable external{
        availableFunds += msg.value;
    }

    function _transferEther(uint amount, address payable to) internal{
        require(amount <= availableFunds, "not enough available funds");
        availableFunds -= amount;
        to.transfer(amount);
    }

    modifier onlyInvestors(){
        require(investors[msg.sender] == true, "only investors");
        _;
    }

    modifier onlyAdmin(){
        require(msg.sender == admin, "only admin");
        _;
    }

}
